import React from 'react'
import "./Home.css"

function home() {

  const setDarkMode = () => {
    document.querySelector("body").setAttribute('date-theme', 'dark')
    localStorage.setItem("selectedTheme", "dark")
  };

  const setLightMode = () => {
    document.querySelector("body").setAttribute('date-theme', 'light')
    localStorage.setItem("selectedTheme", "light")
  };



  const toggleTheme = e => {
    if (e.target.checked) setDarkMode();
    else setLightMode()
  };


  return (
    <section>
      <div className='tit'>
      <h1>AI TEST</h1>

      <div className='dark_modes'>
      <input
        className='dark_mode_inputs'
        type='checkbox'
        id='darkmode-toggle'
        onChange={toggleTheme}
      />
      <label className='dark_mode_labels' for='darkmode-toggle'>
        <Sun />
        <Moon />
      </label>
    </div>

      </div>

      <div className='half'>
        <h2>AI Images Generator</h2>
      </div>

      <div className='ain'>

      </div>

      <div className='sea'>
      <input src='text'></input>
      <button>Generate</button>
      </div>
    </section>
  )
}

export default home;
